import React from "react";
import { useNavigate } from "react-router-dom";
import styled from "styled-components"

const Contact = () => {

    const navigate = useNavigate();

    const goToHome = () => {
        navigate("/");
    };

    const goToProfile = () => {
        navigate("/profile");
    };

    const goToProject = () => {
        navigate("/project");
    };

    const goToContact = () => {
        navigate("/contact");
    };

    return (
        <>
            <Body>
                <BookCover>
                    <Page>
                        <Main>
                            <Bind>
                                <Filed>
                                    <FiledTop>Contact </FiledTop>
                                    <FiledCenter>
                                        <Bind2>
                                            {/* <FiledIcon1>
                                                <FiledIconImage1 img src="/background/Call.png" alt="call" />
                                            </FiledIcon1>
                                            <FiledIcon2>
                                                <FiledIconImage1 img src="/background/Mail.png" alt="mail" />
                                            </FiledIcon2> */}
                                        </Bind2>

                                        <Bind3>
                                            <FiledText1>010-9386-9804</FiledText1>
                                            <FiledText2>jaehooo13@naver.com</FiledText2>
                                        </Bind3>
                                        <FiledBottom>
                                            <FiledBottomImage img src="/background/Last.png" alt="last" />
                                        </FiledBottom>
                                    </FiledCenter>
                                </Filed>

                                <Right>
                                    <RightButton1 onClick={goToHome}>Home</RightButton1>
                                    <RightButton2 onClick={goToProfile}>Profile</RightButton2>
                                    <RightButton3 onClick={goToProject}>Project</RightButton3>
                                    <RightButton4 onClick={goToContact}>Contact</RightButton4>
                                </Right>
                            </Bind>
                        </Main>
                    </Page>
                </BookCover>
            </Body >
        </>
    );
}

export default Contact;

const Body = styled.div`
    font-size: 16px;
    background-color: #a3a3a3;
    background-image: url(/background/pattern.png);
    background-size: 100px;
    position: fixed;
    left: 0;
    top: 0;
    right: 0;
    bottom: 0;
`

const BookCover = styled.div`
    width: 70%;
    height: 50rem;
    border: 2px solid #738186;
    border-radius: 2rem;
    background-color: #b4d1da;
    margin: 0 auto;
    margin-top: 5rem;
`

const Page = styled.div`
    width: 96%;
    height: 47rem;
    border: 3.5px dashed white;
    border-radius: 1rem;
    margin: 0 auto;
    margin-top: 1rem;
`

const Main = styled.div`
    width: 97%;
    height: 45rem;
    border: 2px solid #d4d4d4;
    border-radius: 1rem;
    background-color: #d4d4d4;
    margin: 0 auto;
    margin-top: 1rem;
`

const Bind = styled.div`
    display: flex;
    flex-direction: row;
`

const Filed = styled.div`
    width: 95%;
    height: 43rem;
    /* border: 2px solid red; */
    border-radius: 1rem;
    background-color: rgba(255, 255, 255, 0.4);
    margin-top: 1rem;
    margin-left: 2rem;
`

const FiledTop = styled.div`
    width: 100%;
    height: 1.2rem;
    font-size: 1.2rem;
    color: #3B87AB;
    font-weight: bold;
    margin-top: 1.2rem;
    margin-left: 1.2rem;
    /* margin-bottom: 0.5rem; */
    /* border: 2px solid black; */
`


const FiledCenter = styled.div`
    width: 95%;
    height: 38rem;
    margin: 0 auto;
    font-size: 1.2rem;
    /* margin-top: 1.1rem;
    margin-left: 1.1rem; */
    color: #3B87AB;
    background-color: white;
    font-weight: bold;
    border-radius: 1rem;
    /* border: 2px solid black; */
`

const Bind2 = styled.div`
    display: flex;
    flex-direction: row;
    display: flex;
    justify-content: center;
    margin-top: 2rem;
    /* border: 2px solid red; */
`

const FiledIcon1 = styled.div`
    width: 8%;
    height: 5rem;
    border: 2px solid black;
    border-radius: 1rem;
    margin-right: 16rem;
    margin-top: 2rem;
`

const FiledIconImage1 = styled.img`
    width: 100%;
    height: 100%;
    object-fit: cover;
    border-radius: 1rem;
`

const FiledIcon2 = styled.div`
    width: 8%;
    height: 5rem;
    border: 2px solid black;
    border-radius: 1rem;
    margin-top: 2rem;
`


const Bind3 = styled.div`
    display: flex;
    flex-direction: row;
    display: flex;
    justify-content: center;
    /* width: 100%; */
    /* margin-top: 2rem;
    border: 2px solid red; */
`

const FiledText1 = styled.div`
    width: 25%;
    height: 3rem;
    /* border: 2px solid blue; */
    border-radius: 1rem;
    margin-right: 5rem;
    margin-top: 1rem;
    font-size: 1.5rem;
    display: flex;
    justify-content: center;
    align-items: center;
`

const FiledText2 = styled.div`
    width: 25%;
    height: 3rem;
    /* border: 2px solid blue; */
