    display: flex;
    justify-content: center;
    align-items: center;
`


const FiledBottom = styled.div`
    width: 95%;
    height: 25rem;
    margin: 0 auto;
    margin-top: 1rem;
    /* margin-left: 1.1rem; */
    /* border: 2px solid black; */
`

const FiledBottomImage = styled.img`
    width: 100%;
    height: 100%;
    object-fit: cover;
    border-radius: 1rem;
`

const Right = styled.div`
    width: 10%;
    height: 40rem;
    /* border: 2px solid blue; */
    /* margin-left: 3rem; */
    margin-top: 2rem;
`

const RightButton1 = styled.button`
    width: 100%;
    height: 3rem;
    border: 2px solid grey;
    border-top-right-radius: 0.5rem;
    border-bottom-right-radius: 0.5rem;
    margin-top: 4rem;
    font-size: 1.5rem;
    white-space: nowrap;
    overflow: hidden;
    text-overflow: ellipsis;
    cursor: pointer;
    color: white;
    background-color: #3B87AB;
    display: flex;
    float: left;
    align-items: center;
`

const RightButton2 = styled.button`
    width: 100%;
    height: 3rem;
    border: 2px solid grey;
    border-top-right-radius: 0.5rem;
    border-bottom-right-radius: 0.5rem;
    margin-top: 1rem;
